        if (year < 2300) {
            year = year + 543; // แปลง ค.ศ. เป็น พ.ศ.
        }
        if (format === 'long') {
            const thaiMonths = [
                'มกราคม',
                'กุมภาพันธ์',
                'มีนาคม',
                'เมษายน',
                'พฤษภาคม',
                'มิถุนายน',
                'กรกฎาคม',
                'สิงหาคม',
                'กันยายน',
                'ตุลาคม',
                'พฤศจิกายน',
                'ธันวาคม'
            ];
            return `${day} ${thaiMonths[month]} ${year}`;
        }
        // รูปแบบสั้น: DD/MM/YYYY
